const { strapi } = require("../../axios");

export const getMessagesByGq = async() => {
  let gq = `
        query{
            orders{
            id
            visitor{
                id
                chat_id
                username
            }
            users_permissions_user{
                username
                id
            }
            type{
                id
                name
            }
            checked
            }
        }
    `;

    const orders = strapi.request('post', 'graphql', {data:{
        query: gq
    }})

    return orders.data

};
